// Combine all Tavily search results into raw text for AI processing
const searchData = $('Aggregate Search Results').first().json;
const variables = $('Set Variables').first().json;

let allContent = '';
if (searchData.searchResults) {
  for (const result of searchData.searchResults) {
    if (result.results) {
      for (const r of result.results) {
        allContent += (r.title || '') + ': ' + (r.content || '') + '\n\n';
      }
    }
    if (result.answer) {
      allContent += 'Summary: ' + result.answer + '\n\n';
    }
  }
}

return {
  json: {
    rawContent: allContent.substring(0, 6000),
    frequency: variables.frequency,
    customMessage: variables.customMessage,
    currentDate: variables.currentDate,
    region: variables.region
  }
};

// Parse AI output to extract stats JSON and commentary
const data = $('Parse Rental Data').first().json;
const aiOutput = $input.first().json.output || '';
const frequency = data.frequency;
const currentDate = data.currentDate;
const customMessage = data.customMessage;

// Extract stats JSON from AI output
let stats = {
  avgRent1BR: 'N/A',
  avgRent2BR: 'N/A',
  avgRent3BR: 'N/A',
  vacancyRate: 'N/A',
  monthlyChange: 'N/A',
  yearlyChange: 'N/A'
};

const statsMatch = aiOutput.match(/---STATS_JSON---\s*([\s\S]*?)\s*---END_STATS---/);
if (statsMatch) {
  try {
    const parsed = JSON.parse(statsMatch[1].trim());
    stats = { ...stats, ...parsed };
  } catch (e) {
    // Try to find JSON object in the match
    const jsonMatch = statsMatch[1].match(/\{[\s\S]*\}/);
    if (jsonMatch) {
      try { stats = { ...stats, ...JSON.parse(jsonMatch[0]) }; } catch (e2) {}
    }
  }
}

// Extract commentary (everything after ---END_STATS--- or if no markers, use full output)
let commentary = '';
const commentaryMatch = aiOutput.match(/---END_STATS---\s*([\s\S]*)/);
if (commentaryMatch) {
  commentary = commentaryMatch[1].replace(/^[\s\n]*(?:2\.\s*)?(?:MARKET COMMENTARY:?\s*)?/i, '').trim();
} else {
  commentary = aiOutput;
}

const frequencyLabel = frequency === 'weekly' ? 'Weekly' : 'Monthly';

const customMessageBlock = customMessage ? `
  <tr>
    <td style="padding: 0 30px 30px 30px;">
      <table role="presentation" style="width: 100%; background-color: #fef3c7; border-left: 4px solid #f59e0b; border-radius: 4px;">
        <tr>
          <td style="padding: 15px 20px;">
            <p style="margin: 0; font-weight: bold; color: #92400e; font-size: 14px;">Personal Note</p>
            <p style="margin: 8px 0 0 0; color: #78350f; font-size: 15px; line-height: 1.5;">${customMessage}</p>
          </td>
        </tr>
      </table>
    </td>
  </tr>` : '';

const htmlEmail = `<!DOCTYPE html>
<html>
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>St. George Rental Market ${frequencyLabel} Report</title>
</head>
<body style="margin: 0; padding: 0; font-family: Arial, Helvetica, sans-serif; background-color: #f4f4f4;">
  <table role="presentation" style="width: 100%; border-collapse: collapse;">
    <tr>
      <td align="center" style="padding: 40px 0;">
        <table role="presentation" style="width: 600px; border-collapse: collapse; background-color: white; box-shadow: 0 4px 6px rgba(0,0,0,0.1); border-radius: 8px; overflow: hidden;">
          <tr>
            <td style="background: linear-gradient(135deg, #667eea 0%, #764ba2 100%); padding: 40px; text-align: center;">
              <h1 style="color: white; margin: 0; font-size: 28px; font-weight: bold;">St. George Rental Market Report</h1>
              <p style="color: rgba(255,255,255,0.9); margin: 8px 0 0 0; font-size: 16px;">${frequencyLabel} Update | ${currentDate}</p>
            </td>
          </tr>
          <tr>
            <td style="padding: 30px;">
              <table role="presentation" style="width: 100%; border-collapse: separate; border-spacing: 10px;">
                <tr>
                  <td style="width: 33%; background-color: #f8f9fa; padding: 20px; border-radius: 8px; text-align: center;">
                    <p style="margin: 0; font-size: 11px; color: #666; text-transform: uppercase; letter-spacing: 0.5px;">1BR Average</p>
                    <p style="margin: 8px 0 0 0; font-size: 24px; font-weight: bold; color: #333;">${stats.avgRent1BR}</p>
                  </td>
                  <td style="width: 33%; background-color: #f8f9fa; padding: 20px; border-radius: 8px; text-align: center;">
                    <p style="margin: 0; font-size: 11px; color: #666; text-transform: uppercase; letter-spacing: 0.5px;">2BR Average</p>
                    <p style="margin: 8px 0 0 0; font-size: 24px; font-weight: bold; color: #333;">${stats.avgRent2BR}</p>
                  </td>
                  <td style="width: 33%; background-color: #f8f9fa; padding: 20px; border-radius: 8px; text-align: center;">
                    <p style="margin: 0; font-size: 11px; color: #666; text-transform: uppercase; letter-spacing: 0.5px;">3BR Average</p>
                    <p style="margin: 8px 0 0 0; font-size: 24px; font-weight: bold; color: #333;">${stats.avgRent3BR}</p>
                  </td>
                </tr>
                <tr>
                  <td style="width: 33%; background-color: #f8f9fa; padding: 20px; border-radius: 8px; text-align: center;">
                    <p style="margin: 0; font-size: 11px; color: #666; text-transform: uppercase; letter-spacing: 0.5px;">Vacancy Rate</p>
                    <p style="margin: 8px 0 0 0; font-size: 24px; font-weight: bold; color: #333;">${stats.vacancyRate}</p>
                  </td>
                  <td style="width: 33%; background-color: #f8f9fa; padding: 20px; border-radius: 8px; text-align: center;">
                    <p style="margin: 0; font-size: 11px; color: #666; text-transform: uppercase; letter-spacing: 0.5px;">Month/Month</p>
                    <p style="margin: 8px 0 0 0; font-size: 24px; font-weight: bold; color: #10b981;">${stats.monthlyChange}</p>
                  </td>
                  <td style="width: 33%; background-color: #f8f9fa; padding: 20px; border-radius: 8px; text-align: center;">
                    <p style="margin: 0; font-size: 11px; color: #666; text-transform: uppercase; letter-spacing: 0.5px;">Year/Year</p>
                    <p style="margin: 8px 0 0 0; font-size: 24px; font-weight: bold; color: #10b981;">${stats.yearlyChange}</p>
                  </td>
                </tr>
              </table>
            </td>
          </tr>
          <tr>
            <td style="padding: 0 30px 30px 30px;">
              <h2 style="color: #333; font-size: 20px; margin: 0 0 15px 0;">Market Analysis</h2>
              <div style="color: #555; font-size: 15px; line-height: 1.8;">
                ${commentary.replace(/\n\n/g, '</p><p style="margin: 15px 0;">').replace(/\n/g, '<br>')}
              </div>
            </td>
          </tr>
          ${customMessageBlock}
          <tr>
            <td style="padding: 0 30px 30px 30px; text-align: center;">
              <a href="mailto:washingtoncountyproperties@gmail.com" style="display: inline-block; background: linear-gradient(135deg, #667eea 0%, #764ba2 100%); color: white; padding: 14px 32px; text-decoration: none; border-radius: 6px; font-weight: bold; font-size: 15px;">Schedule a Consultation</a>
            </td>
          </tr>
          <tr>
            <td style="background-color: #f8f9fa; padding: 25px 30px; text-align: center;">
              <p style="color: #333; margin: 0; font-size: 14px; font-weight: bold;">Washington County Property Services</p>
              <p style="color: #666; margin: 8px 0 0 0; font-size: 13px;">Daniel Stewart Team | <a href="tel:435-862-3242" style="color: #667eea;">435-862-3242</a></p>
              <p style="color: #999; margin: 12px 0 0 0; font-size: 11px;">Data collected from public sources. Market conditions subject to change.</p>
            </td>
          </tr>
        </table>
      </td>
    </tr>
  </table>
</body>
</html>`;

return {
  json: {
    html_body: htmlEmail,
    subject: 'St. George Rental Market ' + frequencyLabel + ' Report - ' + currentDate,
    stats: stats,
    reportPreview: commentary.substring(0, 300)
  }
};

// Extract contacts from GHL response
const ghlResponse = $input.first().json;
const contacts = ghlResponse.contacts || [];

// Get email data from Build HTML Email node
const emailData = $('Build HTML Email').first().json;

const items = contacts
  .filter(c => c.email)
  .map(contact => ({
    json: {
      email: contact.email,
      firstName: contact.firstName || contact.name || 'Valued Client',
      subject: emailData.subject,
      html_body: emailData.html_body,
      stats: emailData.stats,
      reportPreview: emailData.reportPreview
    }
  }));

// If no contacts, return email data for response
if (items.length === 0) {
  return [{
    json: {
      ...emailData,
      emailsSent: 0,
      message: 'No contacts found with Rental Market Report tag'
    }
  }];
}

return items;

const emailData = $input.first().json;
const stats = emailData.stats;
const reportPreview = emailData.reportPreview;

return {
  json: {
    success: true,
    emailsSent: 0,
    stats: stats,
    reportPreview: reportPreview,
    generatedAt: new Date().toISOString(),
    note: "Email sending requires GHL credentials to be configured"
  }
};
